.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: 'Roboto', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
  color: rgba(26, 241, 255, 0.65);
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.is-loading {
  color: rgba(26, 241, 255, 0.35);
}
.github-Git.no-repository,
.github-Git.too-many-changes,
.github-Git.unsupported-directory {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
  padding: 30px;
  text-align: center;
}
.github-Git.no-repository > *,
.github-Git.too-many-changes > *,
.github-Git.unsupported-directory > * {
  margin: 10px 0;
}
.github-Git.no-repository h1,
.github-Git.too-many-changes h1,
.github-Git.unsupported-directory h1 {
  margin-bottom: 30px;
}
.github-Git.no-repository button,
.github-Git.too-many-changes button,
.github-Git.unsupported-directory button {
  overflow: hidden;
  text-overflow: ellipsis;
}
.github-Git-LargeIcon:before {
  margin-right: 0;
  margin-bottom: 50px;
  width: auto;
  height: auto;
  font-size: 8em;
  color: rgba(39, 83, 99, 0.881);
}
